function Try() {
  return (
    <div className="container">
      {/* Left sticky section */}
      <div className="left">
        <div className="r1"><p>01</p></div>
        <div className="r2"><p>02</p></div>
        <div className="r3"><p>03</p></div>
      </div>

      {/* Right scroll section */}
      <div className="right">
        <div className="img img1"></div>
        <div className="img img2"></div>
        <div className="img img3"></div>
      </div>
    </div>
  );
}

export default Try;
